import os
import sys
from sklearn import feature_extraction
import re
import pandas as pd
from sklearn.feature_extraction.text import TfidfTransformer
from sklearn.feature_extraction.text import CountVectorizer

def func1(path):
    # 设置显示的最大列、宽等参数，消掉打印不完全中间的省略号
    pd.set_option('display.max_columns', 1000)
    pd.set_option('display.width', 1000)
    pd.set_option('display.max_colwidth', 1000)

    # 创建最终返回的空字典
    # df_dict = {}
    # 读取Excel文件
    df = pd.read_excel(path)

    # 替换Excel表格内的空单元格，否则在下一步处理中将会报错
    df.fillna("", inplace=True)

    df_list = []
    corpus = []
    for i in df.index.values:
        # loc为按列名索引 iloc 为按位置索引，使用的是 [[行号], [列名]]
        df_line = df.loc[i, ['IP', 'DNS']].to_dict()
        # df_lineDns = df.loc[i, ['DNS']].to_dict()
        # print(df_lineDns)
        # print(df_line)
        Getdictvalue = df_line['DNS']
        # print(Getdictvalue)
        list = re.sub("A", " ", Getdictvalue, 5)
        df_line['DNS'] = list
        print(df_line)

        # 将每一行转换成字典后添加到列表
        df_list.append(df_line)
        corpus.append(list)
    df_dict = df_list
    print(df_dict)
    print(corpus)
    vectorizer = CountVectorizer()  # 该类会将文本中的词语转换为词频矩阵，矩阵元素a[i][j] 表示j词在i类文本下的词频
    transformer = TfidfTransformer()  # 该类会统计每个词语的tf-idf权值
    tfidf = transformer.fit_transform(
        vectorizer.fit_transform(corpus))  # 第一个fit_transform是计算tf-idf，第二个fit_transform是将文本转为词频矩阵
    word = vectorizer.get_feature_names()  # 获取词袋模型中的所有词语
    weight = tfidf.toarray()  # 将tf-idf矩阵抽取出来，元素a[i][j]表示j词在i类文本中的tf-idf权重
    for i in range(len(weight)):  # 打印每类文本的tf-idf词语权重，第一个for遍历所有文本，第二个for便利某一类文本下的词语权重
        print(u"-------这里输出第", i, u"类文本的词语tf-idf权重------")
        for j in range(len(word)):
            print(word[j], weight[i][j])

if __name__ == "__main__":
    func1('D:\\pycharm\\dictlist\\DNSlist.xlsx')






















